   //}\n\n    // The magic happens here\n    // Loop through with a @while statement until the color combination passes our required ratio. Scale the color by our step value until the expression is false\n    // This might loop 100 times or more depending on the colors\n    $offset: 0;\n    @while color-contrast($fg, $bg) < $ratio and $offset < $maxOffset {\n      $fg: scale-color($fg, $lightness: $step, $saturation: math.div($step, 4));\n      $offset: $offset + math.abs($step);\n      //@debug 'step' $step $original-contrast $fg color-contrast($fg, $bg) $offset;\n    }\n    @return $fg;\n  }\n}\n\n@function max-contrast($fg, $bg: $grey-200, $max: $grey-600) {\n  @if (color-contrast($fg, $bg) > 3) {\n    @return $max;\n  } @else {\n    @return $fg;\n  }\n}\n\n@function stripped-rgb($color) {\n  @return red($color) + ', ' + green($color) + ', ' + blue($color);\n}\n\n@function stripped-hsl($color) {\n  @return hue($color) + ', ' + saturation($color) + ', ' + lightness($color);\n}\n\n@function hsl-map($colors) {\n  // new map\n  $hsl-map: ();\n  // for each defined color\n  @each $name, $color in $colors {\n    $hsl-map: map.merge(\n      $hsl-map,\n      (\n        $name: stripped-hsl($color),\n      )\n    );\n  }\n  @return $hsl-map;\n}\n","@use '../tokens/shame' as newTokens;\n@use 'functions';\n@use 'sass:map';\n\n// old\n@mixin add-disable($background, $color, $border-color) {\n  @if ($background) {\n    @if ($background == true) {\n      $background: newTokens.$form-control-bg-disabled; //map.get(tokens.$disabled-colors, 'background');\n    } @else {\n      $background: newTokens.$form-control-primary-bg-disabled;\n    }\n    background: $background !important; //desaturate(functions.max-contrast($background), 100%);\n  }\n  @if ($color) {\n    @if ($color == true) {\n      $color: newTokens.$text-disabled-color; //map.get(tokens.$disabled-colors, 'color');\n    } @else {\n      $color: newTokens.$text-primary-disabled-color;\n    }\n    color: $color !importan